  const [users, setUsers] = useState([]);

  useEffect(() => {
    userAll();
  }, []);

  const userAll = async () => {
    await userApi.findOneUser(props.id).then((data) => {
      setUsers(data);
    });
  };
  console.info(users);
  return (
    <div>
      <h1>Testing</h1>
    </div>
  );
}
